(function() {
    'use strict';

    // Your code here...

    jQuery(document).ready(function($) {

        //console.log('1231231');
        $('body').append('<img class="toPageTop" title="回到顶部" style="position:fixed;bottom:40px;right:20px;cursor:pointer;border-radius:100%;width:30px;height:30px" src="data:image/png;base64,"  />');

        $(".toPageTop").hide(0);
        //返回顶部的小图标的现隐
        $(window).scroll(function(){
            if($(window).scrollTop() >= 100){
                $(".toPageTop").fadeIn(600);
            }else{
                $(".toPageTop").stop(true,true).fadeOut(600);
            }
        });
        //返回顶部
        $(".toPageTop").click(function(){
            $("html,body").animate({
                scrollTop:0
            },300);
        });

    });

})();